

var tota = {};

(function(){

	tota.storage = {

		browser : {
			ie : false,
			ie9Low : false,
			ie8Low : false,
			ie7Low : false,
			ie9 : false,
			ie8 : false,
			ie7 : false,
			ie6 : false,
			chrome : false,
			firefox : false,
			flash : false
		},
		status : {
			dir : null,
			chkWheel : true,
			cur : 1,
			idx : 1,
			sectionIn : false,
			setIn : false,
			initComplete : false
		},
		w : null,
		h : null,
		hStage : null

	},

	tota.bindEvents = function () {

		tota.animation.wheelEvent();

	},


	tota.init = {
		setVar : function ( ) {
		},

		setAgent : function ( ) {
		},

		setSize : function ( ) {
		},

		etc : function ( ) {
			tota.animation.sectionInit();
		}

	},
	tota.animation = {

		wheelEvent : function ( ) {

			$('body').mousewheel(function(event, delta, deltaX, deltaY) {

				if ( tota.storage.status.initComplete ) {
					tota.storage.status.dir = delta > 0 ? 'up' : 'down'
					tota.animation.handler();
				}

			});

		},


		control : function ( cur ) {
			$('.innerWrap .section').removeClass('curSection');
			$('#section'+cur).addClass('curSection');

		},

		sectionInit : function ( ) {

			$('.loader').hide();

			if ( $('#section1 .obj18').length ) {
			
			}

			if ( !tota.storage.browser.ie8Low ) {
				new TimelineLite({
					onComplete:function(){
						tota.storage.status.initComplete = true;
				
					}
				})
				.from(".bgWrap", 1.5, {x:( (0 * 1920) - (1920-$(window).width())/2 ) - 30, autoAlpha:0}, "-=1")
				.from("#section1 .bgFire",1 ,{autoAlpha:0, y:30}, "-=1")
				// .from("#section1 .obj3",1.5 ,{autoAlpha:0, x:200, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj3",1.5 ,{autoAlpha:0, x:-200, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj4",1 ,{autoAlpha:0, x:0, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj9",1.5 ,{autoAlpha:0, x:-200, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj6",1 ,{autoAlpha:0, x:-280, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj7",1 ,{autoAlpha:0, x:-20, ease:Expo.easeInOut}, "-=1")
				.from("#section1 .obj8",1 ,{autoAlpha:0, x:0, ease:Expo.easeInOut}, "-=1")


				setTimeout(function(){
					TweenMax.to("#section1 .obj6 div", 2 ,{alpha:1})
					$('#section1, .bgParallax, .bgFireWrap').parallaxify();
				
				}, 3000);

				setInterval(function(){

					new TimelineLite({
					onComplete:function(){
						TweenMax.set(".fire", {x:0,y:0})
					}})
					.to(".fire1", 3,{x:$(window).width() + 200, y:-($(window).height() + 200), ease: Power4.easeOut})
					.to(".fire2", 2,{x:$(window).width() - 1200, y:-($(window).height() + 200), ease: Back.easeOut} , "-=2")
					.to(".fire3", 2,{x:$(window).width() - 800, y:-($(window).height() + 200), ease: Power4.easeOut} , "-=1.5")
					.to(".fire4", 5,{x:$(window).width() + 200, y:-($(window).height() + 200), ease: Power2.easeOut} , "-=1.3")
					.to(".fire5", 4,{x:$(window).width() + 100, y:-($(window).height() + 200), ease: Power4.easeOut} , "-=4.2")
					.to(".fire6", 3,{x:$(window).width() - 1200, y:-($(window).height() + 200), ease: Back.easeOut} , "-=2")
					.to(".fire7", 2,{x:$(window).width() - 800, y:-($(window).height() + 200), ease: Power4.easeOut} , "-=1.6")
					.to(".fire8", 5,{x:$(window).width() + 200, y:-($(window).height() + 200), ease: Power2.easeOut} , "-=3")
					.to(".fire9", 4,{x:$(window).width() + 100, y:-($(window).height() + 200), ease: Power4.easeOut} , "-=4.2")

				},3000)


			} else {

				tota.storage.status.initComplete = true;
			

			}

			if ( !tota.storage.browser.flash ) {

			}

			$('#section1 .obj6').append('<div></div>');

			TweenMax.set("#section2 .frame *, #section3 .obj , #section4 .obj, #section5 .obj, .rockWrap", {x:($(window).width() + 1000)});


		},



		section1 : function ( ) {

			new TimelineLite({
				onComplete:function(){
					tota.storage.status.chkWheel = true;
					$('#gnb a, #gnb button').removeAttr('disabled');
				}
			})
			.to("h1.logo", 1, {alpha:0})
			.to(".bgWrap, #section1 .obj4, .bgWrap, .bgFire, #section1 .obj6, #section1 .obj7, #section1 .obj8, #section1 .obj9, #section1 .obj10, #section1 .obj11", 1, {x:0}, "-=1")
			.to("#section1 .obj1, #section1 .obj9, #section1 .obj3", 1, {x:0}, "-=1.2")
			.to("#section1 .obj9, ", 1.5, {x:0}, "-=1.4")

			TweenMax.to(".bgCharMedia", 1, {alpha:0})
			TweenMax.to("#section1 .obj3", 0.5,{alpha:1})
			TweenMax.to("#section1 .obj9", 0.5,{alpha:1})
			tota.storage.status.idx = 1;

		}
		


	}

})();

$(document).ready(function() {

	tota.bindEvents();
	tota.init.setAgent();
	tota.init.setVar();

	if ( !tota.storage.browser.ie8Low ) {

		$('.innerWrap').queryLoader2({
			barColor : '#fff',
			backgroundColor : '#000',
			percentage : true,
			barHeight : 1,
			minimumTime : 200,
			fadeOutTime : 0,
			onComplete : function(){
				setTimeout(function(){
					tota.init.etc();
				}, 500);
			}
		});

	}


});

$(window).load(function() {

	if ( tota.storage.browser.ie8Low ) {

		tota.init.etc();

	}

});


